import React, { useEffect } from 'react'
import Aos from "aos"
import "aos/dist/aos.css"

function LoadingBar() {

    useEffect(() => {
        Aos.init({
            duration: 2000
        });
    }, []);
    return (

            <div class="progress">
                <div class="progress-value">
                    <p class="text-center">70%</p>
                </div>
            </div>
    )
}

export default LoadingBar
